import { useState } from 'react';
import Banner from './Componentes/Banner';
import Formulario from './Componentes/Formulario';
import Time from './Componentes/Time';

function App() {

  const times = [
  {
    nome: 'Programação',
    corPrimaria: '',
    corSecundaria:''
  },
  {
    nome: 'Front-End',
    corPrimaria: '',
    corSecundaria:''
  },
  {
    nome: 'Data Science',
    corPrimaria: '',
    corSecundaria:''
  },
  {
    nome: 'DevOps',
    corPrimaria: '',
    corSecundaria:''
  },
  {
    nome: 'Ux e desing',
    corPrimaria: '',
    corSecundaria:''
  },
  {
    nome: 'Mobile',
    corPrimaria: '',
    corSecundaria:''
  },
  {
    nome: 'inovacao',
    corPrimaria: '',
    corSecundaria:''
  },
  ]


  const [colaboradores, setColaboradores] = useState([])

  const novoColaboradorAdicionado = (colaborador) => {
    console.log("recebido via app.js funcao adicinar novo colaborador", colaborador)
    setColaboradores([...colaboradores, colaborador])
    console.log(colaboradores)
  }

  return (
    <div className="App">
      <Banner />
      <Formulario aoCadastrarColaborador={colaborador => novoColaboradorAdicionado(colaborador)} />
      <Time nome="Programação" />
      <Time nome="Front-End" />
      <Time nome="Data Sciencie" />
      <Time nome="DevOps" />
      <Time nome="Ux e desing" />
      <Time nome="Mobile" />
      <Time nome="inovacao" />
    </div>
  );
}

export default App;
